import React from 'react';

const Home = () => {
  return (
    <header id="header" className="vh-100 carousel slide" data-bs-ride="carousel">
      <div className="container h-100 d-flex align-items-center carousel-inner">
        <div className="text-center carousel-item active">
          <h2 className="text-uppercase text-white">mejores gpus</h2>
          <h1 className="text-uppercase py-2 fw-bold text-white">Recien llegadas</h1>
          <a href="#special" className="btn mt-3 text-uppercase text-white">Compra ahora</a>
        </div>
        <div className="text-center carousel-item">
          <h2 className="text-uppercase text-white">Conoce la RTX4090</h2>
          <h1 className="text-uppercase py-2 fw-bold text-white">Maximo poder</h1>
          <a href="#special" className="btn mt-3 text-uppercase text-white">Comprar</a>
        </div>
      </div>
      <button className="carousel-control-prev" type="button" data-bs-target="#header" data-bs-slide="prev">
        <span className="carousel-control-prev-icon"></span>
      </button>
      <button className="carousel-control-next" type="button" data-bs-target="#header" data-bs-slide="next">
        <span className="carousel-control-next-icon"></span>
      </button>
    </header>
  );
};

export default Home;
